import './App.css';
import React from 'react';

class App extends React.Component {


 onSignIn=()=> {
   const googleUser = window.gapi.auth2.getAuthInstance().currentUser.get();
    var profile = googleUser?.getBasicProfile();
   console.log(profile)    
  }

  render(){
    return (
      <div className="App">
        <header className="App-header">
          <React.Fragment>
              <div className="g-signin2" data-onsuccess="onSignIn" onClick={ this.onSignIn}></div>
            </React.Fragment>

        </header>
      </div>
    );
  }
}

export default App;
